    data: |
      pragma pg
      SELECT col1 AS col1 FROM tab2 cor0 GROUP BY col1, col1, col2 HAVING + - col1 * - col1 * col1 - - COUNT ( * ) * 44 IS NOT NULL;
  - name: tab2

outputs:
  - name: q7389.out
    data: |
      41
      59
      61
